### Summary of Core Topics, Concepts, and Principles

The exam focuses on English language skills, including vocabulary, grammar, comprehension, and communication. Here are the core topics and concepts:

#### Vocabulary
- **Synonyms and Antonyms**: Understanding and identifying words with similar or opposite meanings.
  - Example: Synonym of "surpassed" is "exceed."
- **Word Collocations**: Matching words that frequently appear together.
  - Example: "Bank Account," "Strong Coffee."
- **Phrasal Verbs**: Understanding and using multi-word verbs.
  - Example: "Call by," "Broke up."

#### Grammar
- **Parts of Speech**: Identifying nouns, pronouns, verbs, adjectives, adverbs, conjunctions, and prepositions.
  - Example: In "Raghav is going for a walk," "Raghav" is a noun.
- **Verb Tenses**: Using the correct form of verbs in different tenses.
  - Example: "They bought the house last year."
- **Articles**: Using "a," "an," and "the" correctly.
  - Example: "He gave me a book on my birthday."
- **Adverbs**: Identifying and using adverbs.
  - Example: In "Joseph ran faster than everyone else," "faster" is an adverb.

#### Comprehension
- **Reading Comprehension**: Understanding and interpreting written passages.
  - Example: Analyzing a passage about Twitter and Threads.
- **Contextual Meaning**: Understanding the meaning of phrases and words in context.
  - Example: "Taken a hit" means "be affected badly."

#### Communication
- **Telephonic Conversations**: Completing dialogues with appropriate responses.
  - Example: "Am I talking to Prateek Agarwal?"
- **Idiomatic Expressions**: Understanding and using idioms.
  - Example: "Keep me in the loop" means "keep me updated."

#### Phonetics
- **Sounds and Pronunciation**: Identifying words with specific sounds.
  - Example: "Wet" does not have an "ii" sound.
- **Diphthongs**: Identifying words with diphthongs.
  - Example: "Moot" does not have a diphthong.

